//Finds the biggest element in the set
int FindMax(int nummysort[], int sorta){
	int max = nummysort[0];
	for(int i = 1; i < sorta; i++){
		if(max<nummysort[i]){
			max = nummysort[i];
		}
	}
	return max;
}

//Function to print the array
void PrintArray(int nummysort[], int sorta){
	for (int i = 0; i < sorta; i++){
        printf("%d ",nummysort[i]);
	}
}

//Counting sort algorithm to sort numbers
void CountSort(int nummysort[], int sorta, int pv){
	int finalsort[sorta + 1];
	int count[10] = {0};

 	//Counts the amount of numbers present for each integer(0 - 9)
	for(int i=0;i<sorta;i++){
		count[(nummysort[i]/pv)%10]++;
		comparisons++;
	}

	
	for(int i = 1; i<10;i++){
		count[i] += count[i -1];
	}

	//Places the elements into sorted order
	for(int i = sorta-1; i >= 0; i--){
		finalsort[count[(nummysort[i]/pv)%10]-1] = nummysort[i];
		count[(nummysort[i]/pv)%10]--;
		swaps++;
	}

	for(int i = 0; i < sorta; i++){
		nummysort[i] = finalsort[i];
	}
}

void RadixSort(int nummysort[], int sorta){
	int max = FindMax(nummysort, sorta), i = 1;

	//Iterates through the place values 
	for(int pv = 1; max/pv > 0; pv *=10){	
		
		CountSort(nummysort, sorta, pv);
		i++;
	}
}

